import React from "react";

const ChartCard = () => (
  <div className="bg-white shadow-md rounded-md p-6">
    <div className="flex items-center justify-between mb-4">
      <h2 className="text-lg font-semibold">Latest Spending</h2>
    </div>
  </div>
);

export default ChartCard;
